import React from "react";
import MapChart from "./components/MapChart";

const App = () => {
  return (
    <div>
      <h1>Clickable World Map</h1>
      <MapChart mapName={"Visited"} />
      <MapChart mapName={"Want to Go"}/>
    </div>
  );
};

export default App;
